import { useEffect, useState } from "react";
import { getAllOrders } from "../../api/orderApi";

function OrdersList() {
  const [orders, setOrders] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    getAllOrders()
      .then((data) => {
        console.log("ORDERS RESPONSE ðŸ‘‰", data);

        if (Array.isArray(data)) {
          setOrders(data);
        } else {
          setOrders([]);
        }
      })
      .catch((err) => {
        console.error("Orders error:", err);
        setOrders([]);
      })
      .finally(() => setLoading(false));
  }, []);

  if (loading) {
    return <p>Loading orders...</p>;
  }

  return (
    <div>
      <h2>Orders</h2>

      <p style={{ color: "orange" }}>
        Orders module backend is not implemented yet.
      </p>

      {orders.length === 0 ? (
        <p>No orders to display.</p>
      ) : (
        <table border="1" cellPadding="8">
          <thead>
            <tr>
              <th>Order ID</th>
              <th>User ID</th>
              <th>Date</th>
              <th>Time</th>
              <th>Total Price</th>
            </tr>
          </thead>
          <tbody>
            {orders.map((o) => (
              <tr key={o.orderId}>
                <td>{o.orderId}</td>
                <td>{o.userId}</td>
                <td>{o.date}</td>
                <td>{o.time}</td>
                <td>{o.orderPrice}</td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
}

export default OrdersList;
